import React from "react";
import api from './api';
import {
    NavLink
  } from "react-router-dom";

function Ranking(){
    
      const [atletas, setAtletas] = React.useState(null);

      React.useEffect(() => {
        api.get('')
        .then((response) => {setAtletas(response.data);})
        .catch((err) => console.error(err)); 
      }, []);

      atletas.map(atleta => (
        console.log(atleta.nome)
      ));

        const path = "/atleta/";
        return (
                <div>
                 <h1 id="ranking-title">Atletas</h1>
                  {atletas.map(atleta => (
                     <p><NavLink to={path+atleta.nome}>{atleta.nome} - {atleta.pontos}</NavLink></p>
                  ))}
                  </div>
             );
}

export default Ranking;
